import React from "react";
import Typography from "@material-ui/core/Typography";
//Local imports
import Item from "./Item/Item";
const Items = () => {
	return (
		<>
			<div>
				<Typography>Hi USER_NAME</Typography>
			</div>
			<div>
				<Item />
			</div>
		</>
	);
};

export default Items;
